import React, {Component} from 'react';

export default class UserInfo extends Component {
    constructor(props){
        super(props);
    }

    render(){
        const {user} = this.props;
       return(
        <ul>
            <li>id: {user.id}</li>
            <li>name: {user.name}</li>
            <li>username: {user.username}</li>
            <li>email: {user.email}</li>
            
        </ul>
       );
    }
    
}
